import React, {Fragment, useState} from "react";

const EditElv = ({peak}) => {

  const [peak_elv, setElv] = useState(peak.peak_elv);

  const onSubmitForm = async(e) => {
      e.preventDefault();

      try {
          const body = {peak_elv};
          const response = await fetch(`http://localhost:5000/peaks/${peak.peak_id}`,{
              method: "PUT",
              headers: { "Content-Type": "application/json" },
              body: JSON.stringify(body)
          });
          window.location = "/";
      } catch (err) {
          console.error(err.message);
      };
  };

  return <Fragment>
  <button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target={`#id${peak.peak_id}`}>
    Edit
  </button>

    {/* <div class="modal fade" id={`id${peak.peak_id}`} tabindex="-1" aria-labelledby="editPeak" aria-hidden="true">
      <div class="modal-dialog">
        <div class="modal-content">
          <div class="modal-header">
            <h5 class="modal-title" id="editPeak">Edit Peak</h5>
            <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close" onClick={() => setElv(peak.elv)}>&times;</button>
          </div>
          <div class="modal-body">
             <input type="text" className="form-control" value={peak_elv} onChange={e => setElv(e.target.value)}/>
          </div>
          <div class="modal-footer">
            <button type="button" className="btn btn-primary" data-bs-dismiss="modal" onClick={e => onSubmitForm(e)}>Confirm</button>
            <button type="button" className="btn btn-secondary"  data-bs-dismiss="modal" onClick={() => setElv(peak.elv)}>Exit</button>
          </div>
        </div>
      </div>
    </div> */}

<button type="button" class="btn btn-info" data-bs-toggle="modal" data-bs-target={`#id${peak.peak_id}`}>Edit</button>
            <div class="modal fade" id={`id${peak.peak_id}`} onClick={() => setElv(peak.elv)}>
                <div class="modal-dialog">
                    <div class="modal-content">
                        <div class="modal-header">
                            <h5 class="modal-title">Edit peak</h5>
                            <button type="button" className="btn-close" data-bs-dismiss="modal" onClick={() => setElv(peak.elv)}>&times;</button>
                        </div>

                        <div className="modal-body">
                            <input type="text" className="form-control" value={peak_elv} onChange={e => setElv(e.target.value)}/>
                        </div>

                        <div class="modal-footer">
                            <button type="button" class="btn btn-primary" data-bs-dismiss="modal" onClick={e => onSubmitForm(e)}>Confirm</button>
                            <button type="button" class="btn btn-secondary"  data-bs-dismiss="modal" onClick={() => setElv(peak.elv)}>Exit</button>
                        </div>
                    </div>
                </div>
            </div>
  </Fragment>;
};

export default EditElv;
